class app extends Component {
  constructor() {
    super();
    this.state = {
      todos: [
        {
          id: 1,
          title: "todo 1",
          completed: false,
        },
        {
          id: 2,
          title: "todo 2",
          completed: false,
        },
        {
          id: 3,
          title: "todo 3",
          completed: false,
        },
      ],
    };
  }
  render() {
    return <div>HLO</div>;
  }
}

export default app;
